INSERT INTO `Majors` VALUES (1,1,'Quản trị kinh doanh','EM3','**Trình độ đào tạo**: Đại học\n\n**Hình thức đào tạo**: Chính quy - 4.0 năm\n\n**Học phí**: 27.000.000 VNĐ/ năm\n\n**Học bổng**: Nhiều chính sách học bổng hỗ trợ sinh viên theo học tại trường\n\n**Ký túc xá**: 350.000 VNĐ/tháng\n\n**Tiện ích**:    KTX     Library     Club     Wifi     Lab\n\n**Thời gian tuyển sinh và nộp hồ sơ**: Từ 01/03/2023 đến khi đủ chỉ tiêu\n\n**Thời gian xét tuyển và nhập học**: Dự kiến 18/09/2023','Tổng chỉ tiêu: 100\n\n1. Kỳ thi tốt nghiệp THPT Quốc Gia	35%\n2. Kỳ thi đánh giá năng lực ĐH Quốc Gia	40%\n3. Xét tuyển thẳng	5%\n4. Xét tuyển học lực kết hợp phỏng vấn	10%\n5. Xét GPA, SAT và IELTS	10%\nKỳ thi tốt nghiệp THPT Quốc Gia\nĐiểm chuẩn: 25.83\n\nTổ hợp môn:\nA00: 25.83\nA01: 25.83\nD01: 25.83\n- Dựa vào kết quả kỳ thi tốt nghiệp THPT năm 2023 do Bộ GD&ĐT và các Sở GD&ĐT tổ chức.\n\n- Điểm chuẩn trung bình năm 2023 là: 25.83\n\nKỳ thi đánh giá năng lực ĐH Quốc Gia\n- Dựa vào kết quả kỳ thi Đánh giá tư duy (ĐGTD) do Đại học Bách khoa Hà Nội tổ chức.\n\n- Điểm chuẩn trung bình năm 2023 là: 55.58\n\n**Xét tuyển thẳng**\n\nXét tuyển thẳng học sinh giỏi theo quy định của Bộ Giáo dục và Đào tạo.\n\n**Xét tuyển học lực kết hợp phỏng vấn**\n\nThí sinh tốt nghiệp THPT năm 2023, có điểm TBC học tập các môn văn hóa (trừ 2 môn Thể dục và GDQPAN) từng năm học lớp 10, 11 và lớp 12 ≥ 8.0 và đáp ứng ít nhất một trong những điều kiện quy định của trường.\n\n**Xét GPA, SAT và IELTS**\n\nThí sinh có điểm trung bình chung (TBC) học tập từng năm học lớp 10, 11, 12 ≥ 8.0; có ít nhất 1 trong các chứng chỉ Quốc tế sau: SAT, ACT, A-Level, AP và IB.','Sinh viên tốt nghiệp cử nhân Quản trị kinh doanh (Mã ngành: EM3) tại Đại học Bách khoa Hà Nội được trang bị những kiến thức nền tảng về kinh doanh, kiến thức và kỹ năng làm việc chuyên sâu về các lĩnh vực chức năng và quản trị tổng hợp như: quản trị sản xuất, quản trị tài chính, quản trị nhân lực, quản trị marketing, quản trị công nghệ, quản trị chất lượng, quản trị dự án và quản trị chiến lược.\nChương trình đào tạo sẽ giúp người học hoàn toàn có thể thích nghi với môi trường làm việc thực tiễn kinh doanh sôi động hiện nay, để có thể làm việc hiệu quả, đáp ứng yêu cầu của mọi nhà tuyển dụng hay có thể tiếp tục học tập ở trình độ cao hơn.\nCác bạn sinh viên sau khi tốt nghiệp có thể đảm đương các chức vụ sau: Chuyên viên quản lý chất lượng: công việc cụ thể là quản lý và tạo ra những kế hoạch hiệu quả nhất với chi phí thấp nhất cho doanh nghiệp; Bạn cũng có thể bắt đầu với chức vụ nhân viên kinh doanh, trưởng các bộ phận kinh doanh, nhân viên khảo sát thị trường; Nhân viên chăm sóc khách hàng, quan hệ công chúng; Giám đốc marketing; Nghiên cứu, giảng dạy tại các trường đại học, cao đẳng.','2024-02-22 07:27:33','2024-02-22 13:35:53',101),(2,1,'Kỹ thuật máy tính','IT2','**Trình độ đào tạo**: Đại học\n\n**Hình thức đào tạo**: Chính quy - 4.0 năm\n\n**Học phí**: 27.000.000 VNĐ/ năm\n\n**Học bổng**: Nhiều chính sách học bổng hỗ trợ sinh viên theo học tại trường\n\n**Ký túc xá**: 350.000 VNĐ/tháng\n\n**Tiện ích**:    KTX     Library     Club     Wifi     Lab\n\n**Thời gian tuyển sinh và nộp hồ sơ**: Từ 01/03/2023 đến khi đủ chỉ tiêu\n\n**Thời gian xét tuyển và nhập học**: Dự kiến 18/09/2023','Tổng chỉ tiêu: 200\n\n1. Kỳ thi tốt nghiệp THPT Quốc Gia	35%\n2. Kỳ thi đánh giá năng lực ĐH Quốc Gia	40%\n3. Xét tuyển thẳng	5%\n4. Xét tuyển học lực kết hợp phỏng vấn	10%\n5. Xét GPA, SAT và IELTS	10%\nKỳ thi tốt nghiệp THPT Quốc Gia\nĐiểm chuẩn: 28.29\n\nTổ hợp môn:\nA00: 28.29\nA01: 28.29\n- Dựa vào kết quả kỳ thi tốt nghiệp THPT năm 2023 do Bộ GD&ĐT và các Sở GD&ĐT tổ chức.\n\n- Điểm chuẩn trung bình năm 2023 là: 28.29\n\n**Kỳ thi đánh giá năng lực ĐH Quốc Gia**\n- Dựa vào kết quả kỳ thi Đánh giá tư duy (ĐGTD) do Đại học Bách khoa Hà Nội tổ chức.\n\n- Điểm chuẩn trung bình năm 2023 là: 79.22\n\n**Xét tuyển thẳng**\n\nXét tuyển thẳng học sinh giỏi theo quy định của Bộ Giáo dục và Đào tạo.\n\n**Xét tuyển học lực kết hợp phỏng vấn**\n\nThí sinh tốt nghiệp THPT năm 2023, có điểm TBC học tập các môn văn hóa (trừ 2 môn Thể dục và GDQPAN) từng năm học lớp 10, 11 và lớp 12 ≥ 8.0 và đáp ứng ít nhất một trong những điều kiện quy định của trường.\n\n**Xét GPA, SAT và IELTS**\n\nThí sinh có điểm trung bình chung (TBC) học tập từng năm học lớp 10, 11, 12 ≥ 8.0; có ít nhất 1 trong các chứng chỉ Quốc tế sau: SAT, ACT, A-Level, AP và IB.','Tại Đại học Bách khoa Hà Nội ngành Kỹ thuật máy tính (Mã ngành: IT2) đào tạo chuyên sâu các lĩnh vực: Mạng máy tính và Truyền thông dữ liệu; An toàn thông tin; Máy tính và Hệ thống nhúng.\nNgành Công nghệ thông tin - Kỹ thuật máy tính là ngành học quan trọng, độc đáo, và duy nhất trong lĩnh vực CNTT tại Đại học Bách khoa Hà Nội cung cấp cho người học kiến thức chuyên môn cả về phần cứng, phần mềm và các kỹ thuật thiết kế và tích hợp tối ưu giữa phần cứng và phần mềm.\nSinh viên tốt nghiệp chuyên ngành Kỹ thuật máy tính có kỹ năng phát triển toàn diện một giải pháp hoàn chỉnh cả phần cứng và phần mềm, đặc biệt chú trọng đến khả năng tích hợp tối ưu giữa phần cứng và phần mềm trong một hệ thống.\nMột số công việc sinh viên có thể đảm nhận như: Lập trình viên phát triển phần mềm cho các hệ thống tính toán; Kỹ sư xây dựng và thiết kế phần mềm cho hệ thống nhúng, nhất là các hệ thống hiện đại; Chuyên viên phát triển hệ thống tích hợp phần mềm và phần cứng, ... Theo khảo sát, 100% sinh viên tốt nghiệp ngành này tại Đại học Bách Khoa Hà Nội có việc làm tại các tập đoàn lớn như: Vingroup, Samsung, VNPT, BKAV, …','2024-02-22 07:32:26','2024-02-22 20:30:47',100),(3,3,'Công nghệ thông tin','CN1','**Trình độ đào tạo**: Đại học\n\n**Hình thức đào tạo**: Chính quy - 4.0 năm\n\n**Học phí**: 26.000.000 VNĐ/ năm\n\n**Học bổng**: Nhiều chính sách học bổng hỗ trợ sinh viên theo học tại trường\n\n**Ký túc xá**: 140.000 VNĐ/tháng\n\n**Tiện ích**:    KTX     Library     Club     Wifi     Lab\n\n**Thời gian tuyển sinh và nộp hồ sơ**: Từ 01/03/2023 đến khi đủ chỉ tiêu\n\n**Thời gian xét tuyển và nhập học**: Dự kiến 16/09/2023','Tổng chỉ tiêu: 120\n\n1. Kỳ thi tốt nghiệp THPT Quốc Gia	40%\n2. Kỳ thi đánh giá năng lực ĐH Quốc Gia	40%\n3. Xét tuyển thẳng	5%\n4. Xét tuyển chứng chỉ IELTS và kết quả THPTQG	10%\n5. Xét GPA, SAT và IELTS	5%\nKỳ thi tốt nghiệp THPT Quốc Gia\nĐiểm chuẩn: 27.85\n\nTổ hợp môn:\nA00: 27.85\nA01: 27.85\nD01: 27.85\n- Dựa trên kết quả thi tốt nghiệp THPT năm 2023.\n\n- Điểm chuẩn trung bình năm 2023: 27.85\n\n**Kỳ thi đánh giá năng lực ĐH Quốc Gia**\n- Dựa vào kết quả thi Đánh giá năng lực (HSA) của ĐHQG Hà Nội năm 2023.\n\n- Điểm chuẩn trung bình năm 2023: 25.\n\n**Xét tuyển thẳng**\n\nXét tuyển thẳng, ưu tiên xét tuyển (học sinh giỏi Quốc gia, tỉnh/thành phố, học sinh hệ chuyên, …)\n\n**Xét tuyển chứng chỉ IELTS và kết quả THPTQG**\n- Xét tuyển bằng chứng chỉ tiếng Anh quốc tế (IELTS, TOEFL) kết hợp với điểm 2 môn thi Toán và Vật lý trong kỳ thi THPT năm 2023.\n\n- Điểm chuẩn năm 2023: 28 điểm.\n\n**Xét GPA, SAT và IELTS**\n- Xét tuyển theo các chứng chỉ quốc tế A-Level, SAT, ACT.\n\n- Điểm chuẩn của chứng chỉ SAT năm 2023 là: 27.5.','**Ngành Công nghệ thông tin** (Mã ngành: CN1) tại Trường Đại học Công nghệ - Đại học Quốc gia Hà Nội (UET-VNU) cũng là một trong những ngành đào tạo hàng đầu về CNTT tại Việt Nam. Chương trình đào tạo được thiết kế để giúp sinh viên có khả năng tiếp cận và áp dụng các công nghệ tiên tiến, tham gia vào các dự án thực tiễn và phát triển kỹ năng lập trình, phát triển phần mềm, mạng máy tính, an toàn thông tin, trí tuệ nhân tạo và ứng dụng CNTT trong các lĩnh vực khác.\nSinh viên tốt nghiệp ngành Công nghệ thông tin có khả năng tham mưu tư vấn và có khả năng thực hiện nhiệm vụ với tư cách như một chuyên viên trong lĩnh vực Công nghệ thông tin, đáp ứng các yêu cầu về nghiên cứu và ứng dụng Công nghệ thông tin của xã hội. Ngoài ra, sinh viên tốt nghiệp ra trường có thể tiếp tục học tập, nghiên cứu và phát triển ngành Công nghệ thông tin trong tương lai.\nCác vị trí công tác có thể đảm nhận như: Lập trình viên hệ thống và cơ sở dữ liệu; Lập trình viên trên môi trường di động, Web; Lập trình viên phát triển các hệ thống thông minh; Chuyên viên phân tích, thiết kế, phát triển hệ thống; .....','2024-03-03 09:31:27','2024-03-03 23:20:55',120);
