INSERT INTO `MarkdownUnis` VALUES (1,'Đại học Bách khoa Hà Nội (Hanoi University of Science and Technology - HUST) là trung tâm đào tạo, nghiên cứu khoa học và công nghệ đa ngành, đa lĩnh vực; kết hợp chặt chẽ giữa đào tạo với nghiên cứu khoa học nhằm tạo nguồn nhân lực chất lượng cao và bồi dưỡng nhân tài khoa học, công nghệ; định hướng phát triển thành đại học nghiên cứu ngang tầm với các đại học có uy tín trong khu vực và trên thế giới.\n\nSứ mạng là \"Phát triển con người, đào tạo nhân lực chất lượng cao, nghiên cứu khoa học, sáng tạo công nghệ và chuyển giao tri thức, phục vụ xã hội và đất nước.\" và tầm nhìn là \"Trở thành một đại học nghiên cứu hàng đầu khu vực với nòng cốt là kỹ thuật và công nghệ, tác động quan trọng vào phát triển nền kinh tế tri thức và góp phần gìn giữ an ninh, hòa bình đất nước, tiên phong trong hệ thống giáo dục đại học Việt Nam\".\n\nMục tiêu:\n\nPhát triển thành một đại học nghiên cứu đa lĩnh vực với nòng cốt là kỹ thuật và công nghệ, trong đó các đơn vị chuyên môn được tổ chức thành một số trường và khoa; viện và trung tâm nghiên cứu trực thuộc.\n\nXây dựng hình mẫu thành công, phát triển bền vững của một đại học tự chủ toàn diện với mô hình quản trị tiên tiến, hệ thống tài chính vững mạnh, hạ tầng khuôn viên và cơ sở vật chất hiện đại ngang tầm khu vực.\n\nXây dựng môi trường học thuật sáng tạo, cởi mở và quốc tế hóa; thu hút sinh viên ưu tú, học giả xuất sắc trong nước và quốc tế đến học tập, nghiên cứu và làm việc.\n\nNâng chất lượng của tất cả các chương trình đào tạo đạt mức cao theo các tiêu chuẩn kiểm định khu vực hoặc quốc tế; đưa Trường lên nhóm đầu khu vực theo xếp hạng khả năng việc làm của người tốt nghiệp.\n\nHình thành một trung tâm sáng tạo công nghệ xuất sắc của khu vực, thu hút mạnh tài trợ và đầu tư của Nhà nước, tổ chức, doanh nghiệp trong và ngoài nước; đưa Trường lên nhóm đầu khu vực theo xếp hạng năng lực sáng tạo.','Năm 2023, Đại học Bách khoa Hà Nội dự kiến tuyển 7.985 chỉ tiêu cho 63 chương trình đào tạo. Trong đó, có 35 chương trình đại trà, 23 chương trình chất lượng cao (16 chương trình giảng dạy bằng tiếng Anh, 3 chương trình có tăng cường ngoại ngữ Nhật, Pháp, 4 chương trình có chuẩn đầu ra ngoại ngữ khác Nhật, Đức), 2 chương trình đào tạo kỹ sư chất lượng cao và 3 chương trình liên kết quốc tế.\r\n\r\nĐối với thí sinh đăng ký xét tuyển vào các chương trình giảng dạy bằng tiếng Anh, ngoài các điều kiện cần thiết (theo các phương thức tuyển sinh), thí sinh cần có một trong những điều kiện về trình độ tiếng Anh như sau: Chứng chỉ tiếng Anh VSTEP trình độ B1 trở lên, IELTS (academic) 5.0 trở lên hoặc tương đương; Điểm thi tốt nghiệp THPT năm 2023 môn tiếng Anh đạt yêu cầu của Đại học Bách khoa Hà Nội.\r\n\r\nTrong mùa tuyển sinh đại học 2022, điểm chuẩn theo kết quả thi tốt nghiệp của trường Đại học Bách khoa Hà Nội từ 23,03 đến 28,29. Ngành Kỹ thuật máy tính có đầu vào cao nhất. Hai ngành có điểm chuẩn cao tiếp theo là Kỹ thuật Điều khiển - Tự động hóa 27,61 và Công nghệ thông tin (Việt - Nhật) 27,25.','Năm 2023, Đại học Bách khoa Hà Nội tuyển sinh 7.985 chỉ tiêu theo 3 phương thức:\r\n\r\n1. Xét tuyển tài năng (XTTN)\r\n\r\n2. Xét tuyển dựa theo kết quả Kỳ thi đánh giá tư duy (ĐGTD)\r\n\r\n3. Xét tuyển dựa theo kết quả thi tốt nghiệp THPT 2023 (THPT).\r\n\r\nKỳ thi đánh giá tư duy của Đại học Bách khoa Hà Nội dự kiến được tổ chức 3 đợt, vào tháng 5, 6 và 7 năm 2023. Năm 2022, kỳ thi này thu hút hơn 7.100 thí sinh tham dự, hơn 20 trường sử dụng kết quả để xét tuyển.\r\n\r\nCác tổ hợp xét tuyển cho phương thức xét tuyển dựa theo kết quả thi tốt nghiệp THPT 2023 là A00, A01, A02, B00, D01, D07, D26, D28 và D29 (tùy theo từng chương trình đào tạo khác nhau). Thí sinh được sử dụng chứng chỉ tiếng Anh VSTEP và quốc tế (IELTS, TOEFL, TOEIC … ) để quy đổi thành điểm tiếng Anh khi xét tuyển theo các tổ hợp A01, D01, D07.','Học phí trường Đại học Bách Khoa Hà Nội dao động từ 24 đến 30 triệu đồng một năm đối với chương trình chuẩn (tùy ngành học); 35 đến 60 triệu đối với các chương trình ELITECH; 42 đến 45 triệu với chương trình song bằng Tiếng Anh chuyên nghiệp quốc tế. Riêng chương trình đào tạo quốc tế, học phí là 25 đến 30 triệu đồng một kỳ. Các mức này có thể được điều chỉnh cho các năm học sau, nhưng không tăng quá 8% mỗi năm.\r\n\r\nHàng năm, trường đều có chính sách học bổng dành cho sinh viên đạt kết quả học tập xuất sắc. Nhà trường thực hiện đầy đủ các chính sách về miễn giảm học phí, trợ cấp xã hội cho tất cả sinh viên thuộc đối tượng ưu đãi theo quy định hiện hành và hỗ trợ thực hiện các thủ tục để sinh viên vay vốn, trang trải chi phí học tập.\r\n\r\nBên cạnh đó, trường cùng với nhiều doanh nghiệp, đơn vị trong và ngoài nước gây dựng nhiều quỹ học bổng nhằm hỗ trợ một phần chi phí cho sinh viên có hoàn cảnh gia đình khó khăn và luôn nỗ lực phấn đấu trong học tập. Nhiều chương trình học bổng, trao đổi sinh viên với các trường đại học đối tác tại nước ngoài sẵn sang hỗ trợ sinh viên có kết quả học tập xuất sắc hay có hoàn cảnh gia đình đặc biệt.','Trường Đại học Bách khoa Hà Nội hiện có đội ngũ, viên chức trình độ chuyên môn cao, có bề dày kinh nghiệm, tâm huyết trong hoạt động đào tạo nghiệp vụ và quản lý, nghiên cứu khoa học và chuyển giao công nghệ. Tính đến tháng 01/2021, đội ngũ cán bộ của Trường là 1.748 cán bộ, giảng viên, trong đó có 22 Giáo sư, 217 Phó Giáo sư, 790 Tiến sĩ. Phần lớn giảng viên của Trường được đào tạo từ các trường đại học danh tiếng trên thế giới (Hoa Kỳ, Pháp, Úc, Nhật Bản…), trong đó gần 74% giảng viên có trình độ tiến sĩ trở lên (đạt tỷ lệ cao nhất trong các cơ sở đào tạo tại Việt Nam).\r\n\r\nSinh viên của Đại học Bách khoa Hà Nội sẽ có có hội được học, được trao đổi và nghiên cứu với những giảng viên có trình độ chuyên môn cao và tâm huyết với nghề. Các giảng viên luôn sẵn sàng hỗ trợ sinh viên về học tập, nghiên cứu và những đề khác trong cuộc sống.','Ký túc xá trường Đại học Bách Khoa Hà Nội hiện nay là một trong những khu ký túc xá được đầu tư đồng bộ và hiện đại. Ký túc xá bao gồm 10 dãy nhà, trong đó có 8 dãy nhà 4-5 tầng, 2 dãy nhà 1 tầng với tổng cộng 435 phòng ở bố trí 8-12 người mỗi phòng, có thể đón nhận 4.200 sinh viên, trong đó có các sinh viên thuộc diện chính sách và sinh viên có hoàn cảnh khó khăn vào ở nội trú. \r\n\r\nNgoài ra, trong ký túc còn có phòng tự học, mỗi phòng có diện tích 100m2 với đầy đủ trang thiết bị. Có thể phục vụ lên đến 80-100 sinh viên. Phòng hội thảo cũng có diện tích tương đương, có máy chiếu, chứa 60-80 sinh viên. \r\n\r\nTrường Đại học Bách Khoa Hà Nội là môi trường để sinh viên rèn luyện và trưởng thành toàn diện bên cạnh việc học tập kiến thức. Nhà trường hiện có gần 60 câu lạc bộ sinh viên trực thuộc Đoàn Thanh niên, Hội sinh viên và các Khoa, Viện trực thuộc, trong đó có hơn 40 CLB học thuật hoạt động tích cực (như CLB tiếng Trung, CLB Hoá học, CLB thuyết trình, CLB Yêu sách Bách Khoa, CLB Thư pháp, CLB Sinh viên NCKH,…).','Thư viện trường Đại học Bách Khoa Hà Nội được thành lập từ năm 1956, ngay sau ngày thành lập trường. Năm 2008, theo sự chỉ đạo của Ban Giám hiệu để phù hợp với tình hình mới, thư viện của trường chính thức tách ra hoạt động độc lập, đổi tên thành thư viện Tạ Quang Bửu.\r\n\r\nThư viện Tạ Quang Bửu là một trong những thư viện lớn nhất Việt Nam. Thư viện có phòng đọc, phòng máy, phòng hội thảo, phòng học và có khả năng phục vụ 2.000 sinh viên với 60.000 đầu sách khác nhau. Tại đây cũng là nơi diễn ra rất nhiều hoạt động khác như hội thảo, triển lãm và các buổi tham quan dành cho tân sinh viên.','https://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320624/nehbpol3lrin3eagyyw7.png','https://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320623/ojfwbvg5w6j4ckpewpop.webp','2024-02-21 06:22:57','2024-02-21 06:22:57'),(3,'**Trường Đại học Công Nghệ – Đại học Quốc gia Hà Nội** (VNU University of Engineering and Technology - VNU-UET) có tầm nhìn tới năm 2035 với mục tiêu sẽ trở thành cơ sở giáo dục đại học hàng đầu trong cả nước trên cả ba tiêu chí: tiên phong, sáng tạo và dẫn dắt trong lĩnh vực đào tạo nguồn nhân lực bậc cao và khoa học công nghệ tiên tiến. \r\n\r\n**Mục tiêu** của Trường Đại học Công nghệ là: \r\n\r\n- Bồi dưỡng nhân tài; nghiên cứu phát triển và ứng dụng các lĩnh vực khoa học – công nghệ tiên tiến; tiên phong tiếp cận chuẩn mực giáo dục đại học khu vực và thế giới, đóng góp tích cực vào sự phát triển nền kinh tế và xã hội tri thức của đất nước.\r\n\r\n- Đổi mới sáng tạo: vừa là phương thức, mục tiêu, động lực và tư duy phát triển của Trường Đại học Công nghệ. \r\n\r\n- Hợp tác: Hợp tác Trường – Viện – Doanh nghiệp, giá trị của Trường trong thời kỳ đầu sẽ được phát triển toàn diện với các bên liên quan trong hệ sinh thái đại học. \r\n\r\n- Phát triển phù hợp với chủ trương, chính sách, chiến lược phát triển kinh tế- xã hội, giáo dục, khoa học và công nghệ của đất nước, Chiến lược phát triển chung của Đại học Quốc gia Hà Nội.\r\n\r\n- Duy trì và nâng cao chất lượng đào tạo, gắn chặt nội dung đào tạo với nhu cầu xã hội, đảm bảo khả năng có việc làm của sinh viên sau tốt nghiệp.\r\n\r\n- Phát triển ngành, chuyên ngành đào tạo của Trường một cách linh hoạt, phù hợp với quy hoạch đào tạo của Đại học Quốc gia Hà Nội và xu hướng phát triển của xã hội trong bối cảnh Cuộc cách mạng công nghiệp lần thứ 4; chú trọng đào tạo tài năng, chất lượng cao.\r\n\r\n- Đa dạng hóa các loại hình đào tạo theo hướng xã hội hóa nhằm một mặt đáp ứng yêu cầu phát triển xã hội, mặt khác khai thác một cách hiệu quả tiềm năng phát triển của Trường (đào tạo liên kết quốc tế, đào tạo ngắn hạn, đào tạo theo đặt hàng của nhà tuyển dụng…).','Năm 2023, Trường Đại học Công nghệ – Đại học Quốc gia Hà Nội tiếp tục tuyển sinh dự kiến chỉ tiêu tuyển sinh với số lượng chỉ tiêu là **1.850 thí sinh** cho **17 ngành đào tạo** bao gồm: 12 ngành chương trình đào tạo chuẩn và 5 ngành chương trình đào tạo chất lượng cao thông qua 5 phương thức xét tuyển. Phạm vi tuyển sinh cả nước, đối tượng tuyển sinh là người đã được công nhận tốt nghiệp trung học phổ thông (THPT) của Việt Nam hoặc có bằng tốt nghiệp của nước ngoài được công nhận trình độ tương đương.\r\n\r\nVới sứ mệnh được Chính phủ giao là “Đào tạo nguồn nhân lực trình độ đại học, sau đại học và bồi dưỡng nhân tài thuộc lĩnh vực khoa học, công nghệ; nghiên cứu và triển khai các ứng dụng khoa học, công nghệ đáp ứng nhu cầu phát triển kinh tế- xã hội”, sau nhiều năm xây dựng và phát triển trên cơ sở kế thừa và phát huy các thế mạnh, truyền thống Trường Đại học Công nghệ – Đại học Quốc gia Hà Nội đã khẳng định được vị thế là một cơ sở đào tạo đại học có uy tín trong hệ thống giáo dục đại học của cả nước, là địa chỉ tin cậy, tiềm năng về đào tạo và nghiên cứu đối với đối tác, doanh nghiệp trong và ngoài nước.','Năm 2023, Trường Đại học Công nghệ – Đại học Quốc gia Hà Nội dự kiến tuyển sinh 1.850 chỉ tiêu với phạm vi toàn quốc.\r\n\r\n**Đối tượng tuyển sinh:**\r\n\r\n+ Người đã được công nhận tốt nghiệp trung học phổ thông (THPT) của Việt Nam hoặc có bằng tốt nghiệp của nước ngoài được công nhận trình độ tương đương;\r\n\r\n+ Người đã có bằng tốt nghiệp trung cấp ngành nghề thuộc cùng nhóm ngành dự tuyển và đã hoàn thành đủ yêu cầu khối lượng kiến thức văn hóa bậc THPT theo quy định của pháp luật (sau đây gọi chung là tốt nghiệp THPT);\r\n\r\n+ Có đủ thông tin cá nhân, hồ sơ dự tuyển theo quy định;\r\n\r\n+ Có đủ sức khoẻ để học tập theo quy định hiện hành.\r\n\r\n**Phương thức tuyển sinh**: Xét tuyển theo các hình thức sau:\r\n\r\n+ Phương thức 1: Xét tuyển dựa trên kết quả thi tốt nghiệp THPT năm 2023.\r\n\r\n+ Phương thức 2: Xét tuyển các chứng chỉ quốc tế (A-Level, SAT, ACT).\r\n\r\n+ Phương thức 3: Xét tuyển bằng chứng chỉ tiếng Anh quốc tế (IELTS, TOEFL) kết hợp với điểm 2 môn thi Toán và Vật lý trong kỳ thi THPT năm 2023.\r\n\r\n+ Phương thức 4: Xét tuyển bằng kết quả thi Đánh giá năng lực (HSA) của ĐHQG Hà Nội năm 2023.\r\n\r\n+ Phương thức 5: Xét tuyển thẳng, ưu tiên xét tuyển (học sinh giỏi Quốc gia, tỉnh/thành phố, học sinh hệ chuyên, …)','Căn cứ Nghị định 81/2021/NĐ-CP ngày 27/8/2021 của Thủ tướng Chính phủ quy định về cơ chế thu, quản lý học phí đối với cơ sở giáo dục thuộc hệ thống giáo dục quốc dân và chính sách miễn, giảm học phí, hỗ trợ chi phí học tập; giá dịch vụ trong lĩnh vực giáo dục, đào tạo. Trường Đại học Công nghệ – Đại học Quốc gia Hà Nội có mức học phí chính quy đối với các chương trình đào tạo chuẩn dao động 17,4 triệu đồng/ năm học đến 26,1 triệu đồng/ năm học (tùy theo từng ngành), chất lượng cao là 35 triệu đồng/năm học và giữ ổn định trong toàn khóa học.. Đối với một số chương trình đào tạo chuẩn chưa có sinh viên tốt nghiệp, các ngành đào tạo theo đặt hàng của Đại học Quốc gia Hà Nội (Công nghệ (CN) Hàng không Vũ trụ, CN Kỹ thuật Xây dựng, CN Nông nghiệp) cần đầu tư nâng cao điều kiện đảm bảo chất lượng đào tạo, các ngành có đối tượng tuyển sinh ở vùng kinh tế khó khăn sẽ áp dụng mức thu học phí ưu đãi.\r\n\r\nVới mong muốn khích lệ tinh thần học tập thi đua và hỗ trợ phần nào cho các bạn sinh viên Trường Đại học Công nghệ – Đại học Quốc gia Hà Nội trong suốt quãng thời gian học tập. Trường đã có nhiều quỹ học bổng theo các chương trình khác nhau mức học bổng cho 1 sinh viên trên 1 tháng dao động từ 1,000,000đ - 2,000,000đ.','Hiện nay, Trường Đại học Công nghệ – Đại học Quốc gia Hà Nội hiện có 302 cán bộ trong đó có 228 giảng viên, nghiên cứu viên và 74 cán bộ hành chính, phục vụ. Nhà trường luôn tự hào có đội ngũ cán bộ, giảng viên, nghiên cứu viên trình độ cao có học vị tiến sĩ trở lên chiếm tỷ lệ 56%, trong đó tỉ lệ giáo sư và phó giáo sư đạt 14,2%. Bên cạnh đó, Nhà trường còn có đội ngũ giáo sư kiêm nhiệm đến từ các trường đại học và viện tiên tiến trên thế giới.\r\n\r\nTừ nhiều năm nay, Trường Đại học Công nghệ – Đại học Quốc gia Hà Nội đã và đang tạo lập, phát triển môi trường đào tạo chuẩn mực, môi trường nghiên cứu tích cực, tự do học thuật trong đó mỗi giảng viên là một nhà khoa học, sinh viên được phát huy tối đa năng lực sáng tạo trong học tập, nghiên cứu và khởi nghiệp. Hoạt động đào tạo gắn với nghiên cứu khoa học và nhu cầu thực tiễn của doanh nghiệp và xã hội bởi vậy sinh viên theo học tại trường không chỉ được trang bị những kiến thức và kỹ năng nghề nghiệp trong một lĩnh vực cụ thể mà còn có năng lực học tập suốt đời, năng lực sáng tạo, năng lực lãnh đạo và kỹ năng giải quyết vấn đề phức tạp. Để thực hiện các quan điểm phát triển này, Trường luôn coi trọng phát triển đội ngũ cán bộ, giảng viên trình độ cao.','Ký túc xá Trường Đại học Công nghệ – Đại học Quốc gia Hà Nội thuộc ký túc xá của Đại học Quốc gia Hà Nội sở hữu 3 ký túc xá gồm KTX Mễ trì, KTX Mỹ đình, KTX Ngoại ngữ. Toàn bộ phòng của 3 ký túc xá đều khép kín, điện nước đảm bảo 24/24. Trong phòng ở trang bị đầy đủ các trang thiết bị cần thiết. Trong mỗi phòng sẽ có giường tầng, kệ để sách, và có cả điều hòa nhiệt độ. Đảm bảo sự tiện nghi và thoải mái cho các bạn sinh viên khi sinh hoạt và học tập với mức lệ phí dao động từ 140.000đ- 250.000đ/ tháng/ sinh viên (Từ phòng chuẩn đến phòng điều hòa).\r\n\r\nNhằm giúp cho các bạn sinh viên Trường Đại học Công nghệ – Đại học Quốc gia Hà Nội cũng có nhiều cơ hội để tham gia các hoạt động ngoại khóa bổ ích giúp rèn luyện tư duy, nhân phẩm, thể chất và phát huy những tài năng riêng biệt với 6 liên chi hội và 17 câu lạc bộ như: CLB Hỗ trợ sinh viên trường ĐHCN – SGUET, CLB Thuyết trình, CLB Nguồn nhân lực – HRTech, CLB Robotics, CLB Hàng không Vũ trụ trường Đại học Công nghệ – AC UET, ....','Thư viện Trường Đại học Công Nghệ – Đại học Quốc gia Hà Nội trực thuộc thư viện ĐHQGHN là nơi quản lý Phòng Tư liệu của trường Đại học Công nghệ, cho mượn sách giáo trình, tham khảo, luận văn, báo chí phục vụ nhu cầu học tập, giải trí của cán bộ và sinh viên.\r\n\r\nTrung tâm Thư viện - Tri thức số được thành lập theo quyết định số 66/TCCB ngày 14 tháng 2 năm 1997 của Giám đốc Đại học Quốc gia Hà Nội (ĐHQGHN) trên cơ sở hợp nhất các thư viện của các trường đại học thuộc ĐHQGHN. Trung tâm là một đơn vị sự nghiệp trực thuộc ĐHQGHN, có tư cách pháp nhân, có con dấu và tài khoản riêng.\r\n\r\nTạo môi trường học tập và hoạt động đầy bổ ích cho sinh viên thông qua các hoạt động trực thư viện, tư vấn giúp sinh viên tìm, mượn và trả sách, giáo trình. Xây dựng môi trường cùng nhau học tập, cùng nhau hoạt động tình nguyện, gắn kết thành viên thông qua những hoạt động chuyên môn.','https://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320624/jhfz9fyonlgbjpvvuz7y.webp','https://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320624/m6mgabzr1sw4qw0tfutk.webp','2024-03-03 09:24:07','2024-03-03 09:24:07'),(4,'**Trường Đại học Ngoại thương (Foreign Trade University - FTU)** được biết đến là một trong những cơ sở giáo dục Đại học có danh tiếng và uy tín nhất Việt Nam, cũng là một trong số ít các trường Đại học ở Việt Nam có cơ sở đào tạo ở cả 2 miền Bắc, Nam. Mục tiêu chung của FTU là trở thành đại học đa ngành, đa lĩnh vực, dẫn đầu cả nước về đào tạo kinh tế, kinh doanh và hệ sinh thái đổi mới sáng tạo và khởi nghiệp, cung cấp các sản phẩm xuất sắc trong đào tạo, nghiên cứu khoa học và phục vụ cộng đồng, có vị thế cao trong khu vực Châu Á. Để thực hiện mục tiêu này, chính sách cơ bản của FTU là:\r\n\r\n- Phát triển các ngành/chương trình đào tạo mới hướng tới sự xuất sắc thông qua khơi dậy năng lực cá nhân, hình thành hệ tư tưởng về đổi mới sáng tạo, tư duy mở, rèn luyện bản lĩnh và khả năng thích ứng, làm chủ hệ sinh thái của chính mình.\r\n\r\n - Phát triển các chương trình vệ tinh và chương trình đào tạo ngắn hạn nhằm tăng tính mở, linh hoạt cho các chương trình đào tạo, tạo thêm giá trị và tăng khả năng thích ứng nhanh của người học.\r\n\r\n- Cải tiến các điều kiện đảm bảo chất lượng, tăng cường kiểm định các chương trình đào tạo; tham gia xếp hạng trường trong các bảng xếp hạng quốc tế.\r\n\r\n- Đổi mới cơ chế, chính sách hoạt động khoa học công nghệ theo hướng tăng phân cấp, trao quyền tự chủ, đầu tư trọng điểm phát triển hướng nghiên cứu mũi nhọn.\r\n\r\n- Phát triển hệ sinh thái mở trong đó khẳng định vai trò dẫn dắt trong một số lĩnh vực, môi trường đổi mới sáng tạo và khởi nghiệp có tính quốc tế hóa cao theo hướng cá nhân hóa và tự chủ.\r\n\r\n- Phát triển thương hiệu và văn hoá Đại học Ngoại thương định hướng theo các giá trị cốt lõi của trường.','Năm 2024, Trường Đại học Ngoại Thương dự kiến tuyển sinh 4.130 chỉ tiêu đại học chính quy cho cả trụ sở chính Hà Nội và các cơ sở trực thuộc. Trong năm học 2024-2025, Trường Đại học Ngoại thương dự kiến tuyển sinh ngành khoa học máy tính, chương trình khoa học máy tính và dữ liệu trong kinh tế và kinh doanh.\r\n\r\nĐồng thời, nhà trường bắt đầu tuyển sinh chương trình song bằng với Đại học Queensland (Australia) ngành kinh doanh quốc tế, chương trình kinh doanh quốc tế (International Business) và phân tích dữ liệu kinh doanh (Business Analytics) tại trụ sở chính Hà Nội.','Năm 2024, Trường Đại học Ngoại thương giữ ổn định các phương thức tuyển sinh đại học chính quy như năm 2023, cụ thể như sau:\r\n\r\n- **Phương thức 1**: Xét tuyển dựa trên kết quả học tập THPT dành cho thí sinh tham gia/đạt giải trong kỳ thi HSG quốc gia hoặc trong cuộc thi KHKT quốc gia, đạt giải (nhất, nhì, ba) HSG cấp Tỉnh/Thành phố lớp 11 hoặc lớp 12, và thí sinh thuộc hệ chuyên của trường THPT trọng điểm quốc gia/THPT chuyên. Thời gian đăng ký nguyện vọng: Dự kiến từ ngày 20/05/2024 đến 17h00 ngày 30/05/2024.\r\n\r\n- **Phương thức 2**: Xét tuyển kết hợp giữa Chứng chỉ ngoại ngữ quốc tế và kết quả học tập THPT/chứng chỉ năng lực quốc tế dành cho thí sinh hệ chuyên, hệ không chuyên của các trường THPT. Thời gian đăng ký nguyện vọng: dự kiến từ ngày 20/05/2024 đến 17h00 ngày 30/05/2024.\r\n\r\n- **Phương thức 3**: Xét tuyển kết hợp giữa Chứng chỉ ngoại ngữ quốc tế và kết quả thi tốt nghiệp THPT năm 2024. Thời gian đăng ký xét tuyển: Dự kiến tháng 7 năm 2024 (theo kế hoạch tuyển sinh của Bộ Giáo dục và Đào tạo).\r\n\r\n- **Phương thức 4**: Xét tuyển dựa trên kết quả thi tốt nghiệp THPT năm 2024 theo các tổ hợp môn xét tuyển của trường. Thời gian đăng ký xét tuyển: dự kiến tháng 7/2024 (theo lịch của Bộ Giáo dục và Đào tạo).\r\n\r\n- **Phương thức 5**: Xét tuyển dựa trên kết quả các kỳ thi ĐGNL do ĐHQG Hà Nội, ĐHQG TP.HCM tổ chức trong năm 2024. Thời gian đăng ký nguyện vọng: Dự kiến từ ngày 20/05/2024 đến 17h00 ngày 30/05/2024.\r\n\r\n- **Phương thức 6**: Xét tuyển thẳng năm 2024. Thời gian nộp hồ sơ xét tuyển: Dự kiến tháng 6 năm 2024 theo kế hoạch tuyển sinh của Bộ Giáo dục và Đào tạo.\r\n\r\nNgoài ra, trường còn thực hiện Xét tuyển đặc thù với Chương trình định hướng phát triển quốc tế\r\n\r\n(ĐHPTQT) Kinh tế chính trị quốc tế.','Hiện nay, Trường Đại học Ngoại Thương dự kiến học phí đối với các chương trình đào tạo như sau:\r\n\r\n- Đối với chương trình đại trà: 25 triệu đồng/sinh viên/năm.\r\n\r\n- Chương trình Chất lượng cao dự kiến là 45 triệu đồng/năm.\r\n\r\n- Chương trình tiên tiến dự kiến là 70 triệu đồng/năm.\r\n\r\n- Học phí của các chương trình định hướng nghề nghiệp và phát triển quốc tế: Chương trình Logistics và quản lý chuỗi cung ứng định hướng nghề nghiệp quốc tế, Chương trình Kinh doanh quốc tế theo mô hình tiên tiến Nhật Bản, Chương trình Kế toán – Kiểm toán định hướng nghề nghiệp ACCA, Chương trình CLC Luật kinh doanh quốc tế theo mô hình thực hành nghề nghiệp, dự kiến khoảng 45 triệu đồng/năm. Học phí của chương trình Quản trị khách sạn, Marketing số, Kinh doanh số, Truyền thông Marketing tích hợp dự kiến là 60 triệu đồng/năm.\r\n\r\nNgoài ra còn có nhiều Chương trình Học bổng có giá trị cao và hình thức hỗ trợ tài chính đa dạng cho sinh viên hằng năm.','Trường Đại học Ngoại thương có có đội ngũ cán bộ giảng viên gồm 380 người được đào tạo có trình độ chuyên môn chất lượng xuất sắc, toàn diện, thông thạo nhiều ngôn ngữ đa số là du học sinh đã tốt nghiệp học ở các trường nổi tiếng nước ngoài; trong đó có 43 Phó giáo sư, 107 Tiến sĩ, 237 Thạc sĩ và 147 giảng viên thỉnh giảng. Đội ngũ chuyên môn hùng mạnh này là cơ sở vững chắc để bảo đảm người học tại FTU sẽ đạt trình độ và đẳng cấp nhân lực toàn cầu sau những năm học tại đây.','Ký túc xá Trường Đại học Ngoại Thương tọa lạc tại 91 phố Chùa Láng gồm hai khu riêng biệt: Một tòa nhà 07 tầng khang trang nằm ngay tại cổng vào dành cho sinh viên năm nhất và một dãy nhà 04 tầng ở trong cùng trục đường chính của trường dành cho sinh viên từ năm hai trở lên. Mỗi tầng đều có phòng tự học với đầy đủ bàn ghế, không gian rộng rãi, được trang bị đầy đủ trang, thiết bị sinh hoạt.\r\n\r\nNgoài đầu tư cho chất lượng giảng dạy, trường cũng đặc biệt chú trọng vào các hoạt động ngoại khóa, hỗ trợ học tập, tư vấn tâm lý, hướng nghiệp cho sinh viên, ... Với gần 40 câu lạc bộ khác nhau, từ câu lạc bộ chuyên môn, sở thích, ... sinh viên FTU thường rất năng động và tài năng, và có thể đảm nhận nhiều vị trí công việc khác nhau khi ra trường!','Thư viện trường Đại học Ngoại thương có một vốn tài liệu khá đa dạng, phong phú phục vụ cho công tác đào tạo và nghiên cứu của Nhà trường, bao gồm 252 thư viện báo, tạp chí truyền thống và hệ thống tài liệu điện tử dồi dào, hiện đại (bao gồm cơ sở dữ liệu online, cơ sở dữ liệu số hóa). Thư viện trường Đại học Ngoại thương rất chú trọng công tác phục vụ thông tin, tư liệu. Ngoài ra Thư viện còn tổ chức nhiều hình thức tuyên truyền giới thiệu sách: triển lãm, trưng bày tài liệu, in thư mục sách mới, thông tin trên Cổng Portal của Thư viện, …','https://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320623/aljzfprjszzzn2sr4qnp.webp','https://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320625/devh4sfvwri50hy5juop.webp','2024-03-03 09:41:51','2024-03-03 09:41:51'),(5,'**Trường Đại học Kinh tế Quốc dân (National Economics University - NEU)** được thành lập theo Nghị định số 678-TTg ngày 25 tháng 01 năm 1956 với tên gọi ban đầu là Trường Kinh tế Tài chính. Ngày 22 tháng 10 năm 1985, Bộ trưởng Bộ đại học và Trung học chuyên nghiệp (nay là Bộ Giáo dục và Đào tạo) ra Quyết định số 1443/QĐ-KH đổi tên Trường thành Trường Đại học Kinh tế Quốc dân. Để hoàn thành mục tiêu đến năm 2030, Trường Đại học Kinh tế Quốc dân trở thành đại học tự chủ toàn diện, đi tiên phong trong chuyển đổi số, có hệ thống quản trị hiện đại, thông minh và chuyên nghiệp, có vị trí cao trong các bảng xếp hạng quốc tế, NEU dựa trên những giá trị cốt lõi mà trường có như:\r\n\r\n- **Sáng tạo**. Xây dựng môi trường học tập và nghiên cứu thân thiện, đảm bảo cho viên chức, người lao động, sinh viên, học viên, nghiên cứu sinh được tự do sáng tạo, phát triển tư duy; tôn trọng ý kiến phản biện khách quan, có cơ sở khoa học; giữ vững và phát huy vai trò đi đầu trong đổi mới và sáng tạo, tạo dựng bản sắc riêng.\r\n\r\n- **Đoàn kết**. Tập thể sư phạm Trường là một khối thống nhất, đồng tâm nhất trí vì sự phát triển; sẵn sàng hợp tác, chia sẻ nguồn lực, hỗ trợ và giúp đỡ lẫn nhau để hoàn thành tốt mọi nhiệm vụ. Mạng lưới cựu sinh viên, học viên và các đối tác luôn là một phần gắn bó chặt chẽ của Trường.\r\n\r\n- **Liêm chính**. Tôn trọng sự trung thực, công bằng, minh bạch trong tất cả các hoạt động đào tạo, nghiên cứu và quản trị đại học; công khai, thực hiện nghiêm túc những cam kết đối với người học, viên chức, người lao động, cộng đồng và xã hội.\r\n\r\n- **Hiệu quả**. Hướng tới nâng cao chất lượng, hiệu quả tối ưu nhằm đảm bảo sử dụng tốt nhất và bền vững các nguồn lực; tầm nhìn dài hạn được chú trọng để đảm bảo sự phát triển liên tục.\r\n\r\n- **Trách nhiệm**. Suy nghĩ và hành động với tinh thần trách nhiệm cao, hết mình vì sự nghiệp chung; lợi ích của mỗi cá nhân gắn liền với sự phát triển của Trường.','Chỉ tiêu tuyển sinh 2023 của Trường Đại học Kinh tế Quốc dân dự kiến tuyển 6.200 chỉ tiêu (tăng 100 so với năm 2022) với 60 mã ngành thông qua 3 phương thức xét tuyển. Trường đại học Kinh tế quốc dân tiếp tục mở rộng cơ hội tuyển sinh cho thí sinh trên toàn quốc trong đó: dành 70% tổng chỉ tiêu cho phương thức xét tuyển kết hợp theo đề án riêng, 25% chỉ tiêu xét kết quả điểm thi tốt nghiệp THPT 2023.\r\n\r\nChỉ tiêu các phương thức xét tuyển:\r\n\r\n- Xét tuyển thẳng: 2%\r\n\r\n- Xét tuyển theo kết quả điểm thi tốt nghiệp THPT năm 2023: 25%\r\n\r\n- Xét tuyển kết hợp theo đề án tuyển sinh của Trường: 73%','Năm 2023, Trường Đại học Kinh tế Quốc dân thực hiện 3 phương thức xét tuyển và cơ cấu chỉ tiêu:\r\n\r\n1. Xét tuyển thẳng: 2%\r\n\r\n2. Xét tuyển theo kết quả điểm thi tốt nghiệp THPT năm 2023: 25%\r\n\r\n3. Xét tuyển kết hợp theo đề án tuyển sinh của Trường: 73%\r\n\r\nĐối với phương thức xét tuyển kết hợp áp dụng cho tất cả 60 mã ngành/chương trình tuyển sinh đại học chính quy năm 2023 với 5 nhóm đối tượng như sau:\r\n\r\n- Những học sinh có chứng chỉ quốc tế, SAT 1200/1600 hoặc ACT 26/36 trở lên đủ điều kiện xét tuyển. Trường dự kiến dành 3% chỉ tiêu cho nhóm này.\r\n\r\n- Thí sinh tham gia thi đánh giá năng lực của Đại học Quốc gia Hà Nội hoặc Đại học Quốc gia TP HCM, đạt 85 hoặc 700 điểm trở lên. Chỉ tiêu cho nhóm này khoảng 17-20%.\r\n\r\n- 20% chỉ tiêu dành cho thí sinh có chứng chỉ tiếng Anh quốc tế kết hợp với điểm thi đánh giá năng lực của hai đại học quốc gia. Thí sinh phải có chứng chỉ tiếng Anh tối thiểu từ IELTS 5.5, TOEFL ITP 500, TOEFL iBT 46, TOEIC (Listening và Reading 785, Speaking 160, Writing 150). Yêu cầu về điểm đánh giá năng lực tương tự nhóm hai.\r\n\r\n- Những thí sinh có chứng chỉ tiếng Anh kết hợp với điểm thi hai môn tốt nghiệp THPT với dự kiến 20% chỉ tiêu. Ngoài điều kiện về chứng chỉ giống nhóm bốn, thí sinh phải đạt tối thiểu 20 điểm ở một trong các tổ hợp xét tuyển của trường.\r\n\r\n- Thí sinh là học sinh hệ chuyên của các trường THPT chuyên, điểm trung bình cả ba năm không dưới 8, thi tốt nghiệp THPT đạt 20 điểm trở lên. Điểm xét tuyển là gồm điểm trung bình 6 học kỳ, điểm môn Toán và một môn bất kỳ (thuộc tổ hợp mà trường chấp nhận). Đại học Kinh tế Quốc dân dành 10-15% chỉ tiêu cho nhóm này.\r\n\r\nNgoài ra, năm 2023, trường Đại học Kinh tế quốc dân không xét tuyển riêng với những thí sinh dự thi chương trình Đường lên đỉnh Olympia.','Năm học 2023-2024, Trường Đại học Kinh tế Quốc dân lên kế hoạch tăng học phí nhưng đảm bảo mức tăng không đột ngột, dự kiến không quá 10%. Hiện nay, mức học phí của chương trình chuẩn dao động từ: 16-22 triệu đồng cho một năm.\r\n\r\nHàng năm, Trường Đại học Kinh tế Quốc dân trao hàng trăm suất học bổng từ Học bổng khuyến khích học tập (KKHT) và học bổng doanh nghiệp. Chỉ cần bạn nỗ lực, biết đặt mục tiêu phấn đấu thì việc đạt được học bổng của Trường sẽ nằm trong lòng bàn tay của bạn, vì có rất nhiều mức phù hợp để bạn phấn đấu và đạt được.\r\n\r\nTổng quỹ học bổng (dự kiến) năm 2023 của Trường là khoảng 23 tỷ đồng, trong đó: Học bổng khuyến khích học tập khoảng 19 tỷ đồng và Học bổng của các doanh nghiệp, tổ chức tài trợ là 4 tỷ đồng.\r\n\r\n- Đối với học bổng KKHT, việc xét học bổng dựa trên: điểm trung bình học kỳ (thang 10) + điểm rèn luyện. Mỗi ngành sẽ có khoảng 5% số sinh viên đạt học bổng. Các loại học bổng sẽ xét từ cao đến thấp cho đến khi hết số lượng học bổng.\r\n\r\n- Đối với học bổng của doanh nghiệp, các tiêu chí xét học bổng do các doanh nghiệp đưa ra với những mức học bổng khác nhau. ','Trường Đại học Kinh tế Quốc dân được biết đến là trường kinh tế và kinh doanh chất lượng hàng đầu tại Việt Nam vì NEU đặt chất lượng giảng dạy lên hàng đầu, các chương trình giảng dạy được thiết kế để phù hợp nhất với sinh viên kinh tế.\r\n\r\nĐội ngũ NEU với 1.200 giảng viên và đội ngũ nhân viên bao gồm:\r\n\r\n- Hơn 150 giáo sư và phó giáo sư\r\n\r\n- Hơn 200 tiến sĩ\r\n\r\nVì vậy, NEU chắc chắn có thể cung cấp kiến thức phù hợp và trở thành nơi khởi đầu cho sự thành công của hơn 35.000 sinh viên hàng năm ở bậc Cử nhân, Thạc sĩ và Tiến sĩ các cấp độ.','Kí túc xá Đại học Kinh tế Quốc dân có nhiều loại phòng cũng như mức phí khá phù hợp với ngân sách của các bạn sinh viên dao động từ **460.000VND - 1.500.000VND/1 người/1 tháng** tùy thuộc vào số bạn trong 1 phòng từ 4 – 8 bạn. Kí túc xá NEU cũng có giờ giới nghiêm: 23 giờ cho các ngày từ thứ hai đến thứ sáu và 23 giờ 30 cho thứ bảy, chủ nhật và các ngày lễ. Đến với kí túc xá NEU, các bạn hoàn toàn yên tâm bởi vì các lối ra vào và hành lang các tầng đều được trang bị camera. Đây là thiên đường giao lưu văn nghệ, góc nào cũng có sinh hoạt đội, chỗ ngồi hát, chỗ tổ chức event, … Vậy nên nếu bạn là người thích giao lưu, muốn kết bạn thì kí túc xá là một địa chỉ hàng đầu dành cho bạn. \r\n\r\nNgoài việc là một trong những ngôi trường đào tạo về Kinh tế hàng đầu cả nước, Đại học Kinh tế Quốc dân còn được biết đến là nổi tiếng với các CLB hoạt động vô cùng sôi nổi và năng động. Với hơn 50 CLB, tổ đội đủ mọi lĩnh vực từ Học thuật, Tổ chức sự kiện, Đối Ngoại, Văn nghệ, Thể thao, … và hàng trăm chương trình xịn sò được tổ chức quanh năm, các sinh viên ở NEU có thể tự do lựa chọn và trải nghiệm. Có thể nói Đại học Kinh tế Quốc dân là nơi với các CLB có \"1-0-2\"!','Với vai trò là trường đại học hàng đầu, trọng điểm đào tạo về kinh tế, quản lý, quản trị kinh doanh ở Việt Nam, Trường Đại học Kinh tế Quốc dân được Chính phủ, Bộ GD&ĐT và World Bank lựa chọn là địa điểm, đầu mối đặt thư viện điện tử dùng chung.\r\n\r\nDự án do Ngân hàng thế giới (World Bank) tài trợ với tổng vốn đầu tư lên đến 11 triệu USD, Trường Đại học Kinh tế Quốc dân được giao làm đầu mối triển khai. Thư viện điện tử dùng chung dự kiến tiếp cận khoảng 600.000 sinh viên, 27.000 giảng viên từ các cơ sở giáo dục tại Việt Nam.\r\n\r\nKhông gian thư viện gồm có 3 tầng. Mỗi tầng được thiết kế theo một chủ điểm riêng: tầng 1 là phòng đọc tại chỗ với những đầu sách truyền thống; tầng 2 là phòng đọc hiện đại; tầng 3 là khu vực sáng tạo, cà phê sách. Tổng diện tích sàn sử dụng cho thư viện lên đến 10.440 m2.Hệ thống thư viện điện tử được trang bị cơ sở dữ liệu lớn, đa dạng các lĩnh vực kinh tế, tài chính, khoa học, … với hơn 1 triệu cuốn sách và hơn 1,3 triệu tạp chí.','https://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320623/xswk3or9uxzdk9to0moj.webp','https://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320624/h827jwithw4ecqsxydmu.webp','2024-03-03 09:50:03','2024-03-03 09:50:03'),(6,'**Trường Đại học Thương mại (Thuongmai University - TMU)** là trường đại học công lập trực thuộc hệ thống giáo dục quốc dân nước Cộng hòa xã hội chủ nghĩa Việt Nam.\r\n\r\n- **Mục tiêu**: Là trường đào tạo ra nguồn nhân lực trình độ cao; có phẩm chất chính trị, đạo đức tốt; nắm vững kiến thức chuyên môn và kỹ năng nghề nghiệp; có tinh thần chuyên nghiệp, thái độ tận tâm và sự sáng tạo trong công việc, làm chủ tri thức khoa học và công nghệ hiện đại, có tư duy sáng tạo, khả năng tự học, thích nghi với môi trường làm việc và hội nhập quốc tế; có trách nhiệm với cộng đồng, xã hội.\r\n\r\n+ Tiếp tục duy trì và mở rộng quy mô đào tạo hợp lý trong điều kiện các chương trình đào tạo được phát triển theo sự thay đổi của nhu cầu thị trường lao động; đảm bảo tương thích giữa quy mô, nhu cầu xã hội về các ngành nghề, năng lực đào tạo và yêu cầu không ngừng nâng cao chất lượng đào tạo của Trường. \r\n\r\n+ Hoàn thiện hệ thống đảm bảo chất lượng giáo dục đại học của Trường và công bố công khai kết quả kiểm định.\r\n\r\n+ Nâng cao năng lực nghiên cứu của đội ngũ giảng viên; tập trung phát triển một số lĩnh vực nghiên cứu chiến lược, được công nhận ở tầm quốc gia; gắn kết hoạt động NCKH với nâng cao chất lượng đào tạo.\r\n\r\n- **Sứ mạng**: Là trường đại học công lập, tự chủ, đa ngành; có thế mạnh và uy tín cao trong đào tạo đại học, sau đại học; nghiên cứu và chuyển giao khoa học công nghệ, tri thức trong các lĩnh vực kinh tế và thương mại hiện đại đáp ứng yêu cầu công nghiệp hóa, hiện đại hóa và hội nhập quốc tế.\r\n\r\n- **Tầm nhìn đến năm 2040**: Phát triển Trường Đại học Thương mại theo mô hình “Trường đại học tự chủ, tự chịu trách nhiệm” với chất lượng các nguồn lực và năng lực cốt lõi.\r\n\r\n- **Các giá trị cốt lõi**: Truyền thống - Trách nhiệm - Sáng tạo.','Năm 2023, trường Đại học Thương mại đào tạo thêm năm ngành mới, nâng tổng số ngành đào tạo lên 36 với 4.850 chỉ tiêu, tăng 700 so với năm ngoái.\r\n\r\nNăm 2023, trường Đại học Thương mại lần đầu sử dụng thêm kết quả đánh giá tư duy của Đại học Bách khoa Hà Nội.\r\n\r\nVề phương thức tuyển sinh, trường vẫn duy trì các phương thức tương tự năm 2022, nhưng cơ cấu lại, thành 5 phương thức gồm: xét tuyển thẳng; sử dụng điểm thi tốt nghiệp THPT 2023; xét học bạ (chỉ áp dụng với học sinh trường chuyên, đạt điểm trung bình hàng năm từ 8,5); xét tuyển theo kết quả thi đánh giá năng lực, tư duy; xét tuyển kết hợp.\r\n\r\nTrường Đại học Thương mại chấp nhận 4 tổ hợp xét tuyển gồm: A00 (Toán, Lý, Hoá), A01 (Toán, Lý, Tiếng Anh), D01 (Toán, Văn, Tiếng Anh) và D07 (Toán, Hoá, Tiếng Anh).','Trường Đại học Thương mại lần đầu sử dụng thêm kết quả đánh giá tư duy của Đại học Bách khoa Hà Nội vào năm 2023. Với 4850 chỉ tiêu trường vẫn tiếp tục duy trì các phương thức tương tự năm 2022, nhưng cơ cấu lại thành 5 phương thức.\r\n\r\nCác phương thức xét tuyển:\r\n\r\n- Phương thức 1: Xét tuyển thẳng, ưu tiên xét tuyển theo quy định hiện hành của Bộ GD&ĐT và quy định của Trường\r\n\r\n- Phương thức 2: Xét tuyển theo kết quả thi tốt nghiệp THPT năm 2023. Xét tuyển theo kết quả thi tốt nghiệp THPT năm 2023 theo từng tổ hợp bài thi/môn thi\r\n\r\n- Phương thức 3: Xét tuyển theo kết quả học tập cấp THPT đối với thí sinh trường chuyên/trọng điểm quốc gia. Xét tuyển theo kết quả học tập cấp THPT của thí sinh học 3 năm (lớp 10, 11, 12) tại trường THPT chuyên toàn quốc/trường THPT trọng điểm quốc gia, tốt nghiệp năm 2023 theo từng tổ hợp môn xét tuyển.\r\n\r\n- Phương thức 4: Xét tuyển theo kết quả thi đánh giá năng lực, đánh giá tư duy\r\n\r\n+ Xét tuyển theo kết quả thi đánh giá năng lực do Đại học Quốc gia (ĐHQG) Hà Nội tổ chức năm 2023.\r\n\r\n+ Xét tuyển theo kết quả thi đánh giá tư duy của Đại học Bách Khoa Hà Nội.\r\n\r\n- Phương thức 5: Xét tuyển kết hợp\r\n\r\n+ Xét tuyển kết hợp chứng chỉ quốc tế còn hiệu lực tính đến ngày đăng ký xét tuyển với kết quả thi tốt nghiệp THPT năm 2023.\r\n\r\n+ Xét tuyển kết hợp chứng chỉ quốc tế (CCQT) còn hiệu lực tính đến ngày đăng ký xét tuyển với kết quả học tập cấp THPT.\r\n\r\n+ Xét tuyển kết hợp giải Học sinh giỏi (HSG) với kết quả thi tốt nghiệp THPT năm 2023.','Học phí năm học 2023 - 2024 đối với sinh viên chính quy tuyển sinh năm 2023 của trường Đại học Thương mại như sau:\r\n\r\n- Học phí chương trình đào tạo chuẩn: từ 2.300.000 đến 2.500.000 đồng/tháng theo từng ngành (chuyên ngành) đào tạo.\r\n\r\n- Học phí các chương trình đào tạo chất lượng cao, chương trình tích hợp: từ 3.525.000 đến 4.000.000 đồng/tháng theo từng ngành (chuyên ngành) đào tạo.\r\n\r\n- Học phí các chương trình định hướng nghề nghiệp: 2.500.000 đồng/tháng.\r\n\r\n- Mức thu học phí hàng năm tăng tối đa 12,5% so với năm trước liên kề (Theo Nghị định 81/NĐ-CP ngày 27/08/2021 của Chính phủ).\r\n\r\nNăm 2023, trường dành từ 6 đến 7 tỷ đồng để xét cấp học bổng cho các thí sinh trúng tuyển năm 2023.\r\n\r\nQuỹ học bổng được phân bố căn cứ vào tỷ lệ số thí sinh trúng tuyển và nhập học thực tế theo từng phương thức xét tuyển trên tổng số thí sinh trúng tuyển và nhập học.\r\n\r\nĐiểm xét cấp học bổng là Điểm xét tuyển (không bao gồm điểm ưu tiên theo đối tượng, ưu tiên theo khu vực).\r\n\r\nNgoài ra, nhà trường còn thực hiện chính sách miễn, giảm học phí cho sinh viên thuộc diện chính sách theo các quy định hiện hành của Bộ GD&ĐT và của Nhà nước.\r\n\r\n','Đội ngũ giảng viên của TMU phần đông là các giáo sư, tiến sĩ, theo yêu cầu của bộ giáo dục. Hiện nay trường Đại học Thương Mại đang được trẻ hóa đội ngũ giảng viên, có rất nhiều giảng viên trẻ là thạc sĩ, tiến sĩ. Hiện tại, trường có 150 Chuyên Gia Quốc Tế, 45 Giáo Sư – Phó Giáo Sư, 130 Tiến Sĩ và 400 Thạc Sĩ.\r\n\r\nGiảng viên TMU không chỉ giỏi về chuyên môn mà họ còn rất năng động, nhiệt tình trong việc truyền đạt kiến thức cũng như kỹ năng sống đến với sinh viên.\r\n\r\nĐội ngũ cán bộ, công nhân viên và giảng viên của trường Đại học Thương Mại vô cùng trẻ trung và hiện đại. Các khoa, phòng đều có fanpage riêng, có thể giải đáp mọi thắc mắc của sinh viên một cách kịp thời và tiện lợi. Các thầy cô giáo vô cùng tâm lí và hiểu sinh viên, mọi vấn đề sinh viên có thể liên lạc với giảng viên và lãnh đạo qua chính facebook cá nhân, messenger của mình.\r\n\r\nLà một trường thuộc khối ngành kinh tế, trong nền kinh tế hội nhập, việc giảng dạy ngoại ngữ cũng trở nên cấp thiết. Đáp ứng nhu cầu của thị trường cùng xu thế xã hội, việc đào tạo ngoại ngữ ở đại học thương mại rất được chú trọng. Gần 1/6 giảng viên trong trường đã tham gia thỉnh giảng, du học, ở các quốc gia có nền giáo dục phát triển như: Mỹ, Anh, Pháp, Thụy Điển, Hà lan, …','Kí túc xá Trường Đại học Thương mại gồm 2 khu nhà 3 tầng (A và B) với sức chứa 700 sinh viên, bắt đầu được cải tạo và nâng cấp từ tháng 10/2017. Đến nay đã hoàn thiện với 117 phòng khép kín, diện tích mỗi phòng khoảng 20m2 (6 sinh viên/phòng) trong đó có 14 phòng dành cho sinh viên quốc tế (4 sinh viên/phòng).\r\n\r\nVới giá phòng hợp lí 600.000 đồng/tháng, tiền điện nước được Nhà trường hỗ trợ theo quy định của Nhà nước, bền vững và không tính lũy tiến. Các phòng rộng rãi, thoáng mát được trang bị wifi, điều hòa, nóng lạnh, giường tủ, bàn ghế, nhà vệ sinh khép kín sạch sẽ.\r\n\r\nSinh viên Thương Mại cũng rất năng động bởi hàng chục câu lạc bộ tình nguyện (đội tình nguyện của trường, đội tình nguyện từng khoa, Câu lạc bộ marketing, Câu lạc bộ nhà quản trị thương hiệu, Câu lạc bộ FBA, Câu lạc bộ truyền thông VE media, …). Điều đặc biệt mà sinh viên trường khác ít có được, đó là các câu lạc bộ của trường Đại học Thương Mại đều có văn phòng trực thuộc tại dãy nhà C để các hội viên tiện tham gia họp bàn cũng như các hoạt động của câu lạc bộ.','Thư viện trường Đại học Thương mại được xây dựng với tổng diện tích sàn sử dụng gần 6.000 m2 và được thiết kế theo mô hình không gian học tập chung (Learning Commons) gồm 7 tầng, mỗi tầng được thiết kế theo ý tưởng, phong cách riêng, mới lạ, độc đáo và hiện đại bậc nhất khu vực phía Bắc tại thời điểm hiện nay.\r\n\r\nĐặc biệt, Thư viện được xây dựng theo xu hướng thiết kế không gian học tập, nghiên cứu mở, thân thiện, hiện đại, có sự kết nối giữa các khu vực, nơi các bạn trẻ có thể giao lưu, chia sẻ, phát triển tri thức. Biểu tượng thác nước chảy xuyên suốt từ tầng 11 xuống tầng 1 là hình ảnh tượng trưng cho dòng chảy tri thức qua các thế hệ của các thành viên trong đại gia đình TMU. Ý tưởng thiết kế hai cây cầu nối giữa tòa nhà V-P-F, biểu trưng cho hình ảnh con đường kết nối, truyền tải tri thức giữa các thế hệ Thầy - Trò và giữa các thế hệ Người học tại TMU; Những câu châm ngôn sâu sắc được đưa vào các không gian một cách tinh tế giúp truyền cảm hứng học tập, sáng tạo cho Người sử dụng.\r\n\r\nNguồn tài nguyên thông tin tại TMU LIBRARY khá đa dạng, phong phú ngoài các bộ sưu tập tài liệu của Thư viện như sách, báo tạp chí, luận văn, luận án, khóa luận, kỷ yếu, đề tài NCKH, báo cáo, đề cương bài giảng,… còn có hàng triệu tài nguyên thông tin điện tử do Thư viện mua quyền truy cập hoặc liên kết chia sẻ.\r\n\r\nNgoài ra, TMU LIBRARY còn cung cấp các dịch vụ như: Hỗ trợ học tập, giảng dạy, nghiên cứu; đào tạo kỹ năng thông tin; mượn liên thư viện; lưu hành tài liệu; tư vấn chuyên gia và nhiều dịch vụ khác nhằm hỗ trợ tối đa khả năng tiếp cận và khai thác nguồn tài nguyên phục vụ học tập, nghiên cứu của Người sử dụng thư viện.','https://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320624/sc06evfvpoy8dtslx5xk.webp','https://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320624/xriuboizkmaloivtnxwb.webp','2024-03-03 09:53:58','2024-03-03 09:53:58'),(7,'**Học viện Tài chính (Academy of finance – AOF)** được thành lập theo Quyết định số 120/QĐ-TTg ngày 17/8/2001 của Thủ tướng Chính phủ trên cơ sở sáp nhập 3 đơn vị là Trường Đại học Tài chính - Kế toán Hà Nội, Viện Nghiên cứu Khoa học tài chính và Trung tâm Bồi dưỡng cán bộ - Bộ Tài chính. Năm 2003, Học viện Tài chính tiếp nhận thêm Viện nghiên cứu Khoa học thị trường giá cả và Trường Bồi dưỡng cán bộ thuộc Cục dự trữ Quốc gia.\r\n\r\nHọc viện có chức năng, nhiệm vụ đào tạo cán bộ trình độ Đại học, Sau đại học về các lĩnh vực tài chính, kế toán, quản trị kinh doanh, tiếng Anh Tài chính và Tin học Tài chính kế toán với 4 loại hình đào tạo (Đại học chính quy, Đại học vừa làm vừa học, Đại học bằng 2, Liên thông đại học). Trong suốt những năm qua, Học viện đã đạt nhiều phần thưởng cao quý của Đảng và Nhà nước như: Huân chương Hồ Chí Minh năm 2013; Huân chương Lao động hạng Nhất, hạng Nhì, hạng Ba; Cờ thi đua của Chính phủ và nhiều phần thưởng cao quý khác.\r\n\r\n**Sứ mệnh:** Cung cấp các sản phẩm đào tạo và nghiên cứu khoa học tài chính - kế toán chất lượng cao cho xã hội.\r\n\r\n**Tầm nhìn:** \r\n\r\n- Đến năm 2030, Học viện Tài chính trở thành 1 trong 5 cơ sở giáo dục đại học đa ngành, đa lĩnh vực hàng đầu Việt Nam theo định hướng kết hợp nghiên cứu cơ bản, nghiên cứu ứng dụng và chuyển giao công nghệ về lĩnh vực Kinh tế, Tài chính – Ngân hàng, Kế toán – Kiểm toán, Quản lý – Quản trị, Công nghệ thông tin, Luật kinh tế…\r\n\r\n- Đến năm 2045, đưa Học viện Tài chính trở thành một trong 100 cơ sở giáo dục đại học tốt nhất Châu Á, một trong 1.000 cơ sở giáo dục đại học tốt nhất thế giới theo chuẩn mực xếp hạng quốc tế.\r\n\r\n**Giá trị cốt lõi:** “Chất lượng - Uy tín - Hiệu quả - Chuyên nghiệp và Hiện đại”.\r\n\r\n**Triết lý giáo dục:** \"Công dân toàn cầu trong thế giới thay đổi\"\r\n\r\n**Mục tiêu chiến lược:** Xây dựng, phát triển Học viện Tài chính thành trung tâm đào tạo và nghiên cứu khoa học về Kinh tế - Tài chính - Kế toán hàng đầu Việt Nam, có uy tín trong khu vực.','Năm học 2023 – 2024, Học viện Tài chính thực hiện tuyển sinh 4.200 chỉ tiêu hệ Đại học chính quy, trong đó: Chương trình chuẩn là 3.000 chỉ tiêu; Chương trình đào tạo chất lượng cao là 1.080 chỉ tiêu; Chương trình liên kết đào tạo mỗi bên cấp một bằng cử nhân – DDP là: 120 chỉ tiêu.\r\n\r\nNăm nay, Học viện phân phối chỉ tiêu cho các phương thức tuyển sinh như sau:\r\n\r\n- Chỉ tiêu xét tuyển thẳng và xét tuyển học sinh giỏi THPT ít nhất bằng 60%;\r\n\r\n- Xét tuyển dựa vào kết quả đánh giá năng lực, đánh giá tư duy tối đa 5%\r\n\r\n- Số % còn lại dùng cho phương thức xét tuyển dựa vào kết quả thi tốt nghiệp THPT năm 2023 và xét tuyển kết hợp.','Học viện Tài chính áp dụng 5 phương thức tuyển sinh để tuyển sinh **4.200** chỉ tiêu cho 3 chương trình đào tạo trong năm học 2023 – 2024.\r\n\r\nCác phương thức tuyển sinh:\r\n\r\n- Xét tuyển thẳng và ưu tiên xét tuyển theo quy chế của Bộ GDĐT các đối tượng:\r\n\r\n+ Anh hùng lao động, Anh hùng lực lượng vũ trang nhân dân, Chiến sĩ thi đua toàn quốc đã tốt nghiệp THPT.\r\n\r\n+ Thí sinh đoạt giải Nhất, Nhì, Ba trong kỳ thi chọn học sinh giỏi quốc gia, quốc tế hoặc thi khoa học, kỹ thuật cấp quốc gia, quốc tế do Bộ GDĐT tổ chức, cử tham gia.\r\n\r\n+ Giám đốc Học viện căn cứ kết quả học tập cấp THPT của thí sinh và yêu cầu của ngành đào tạo để xem xét, quyết định nhận vào học.\r\n\r\n- Xét tuyển học sinh giỏi dựa vào kết quả học tập THPT.\r\n\r\n+ Thí sinh đoạt giải Nhất, Nhì, Ba, Khuyến khích (hoặc giải Tư) trong kỳ thi chọn học sinh giỏi quốc gia, quốc tế hoặc thi khoa học, kỹ thuật cấp quốc gia, quốc tế do Bộ GDĐT tổ chức hoặc thí sinh đoạt Huy chương Vàng, Bạc, Đồng (giải cá nhân) trong các cuộc thi đấu thể thao trong nước cấp toàn quốc hoặc trong các giải, đại hội thể thao khu vực, châu lục và thế giới.\r\n\r\n+ Đoạt giải Nhất, Nhì, Ba, Khuyến khích trong kỳ thi chọn học sinh giỏi cấp tỉnh/thành phố trực thuộc Trung ương.\r\n\r\n+ Học lực Giỏi 3 năm bậc THPT, trong đó kết quả học tập năm lớp 12 của mỗi môn thuộc tổ hợp đăng ký xét tuyển không dưới 7,0.\r\n\r\n- Xét tuyển dựa vào kết quả thi tốt nghiệp THPT năm 2023\r\n\r\n- Xét tuyển kết hợp chứng chỉ tiếng Anh quốc tế với kết quả thi tốt nghiệp THPT năm 2023\r\n\r\n- Xét tuyển dựa vào kết quả kỳ thi đánh giá năng lực của Đại học Quốc gia Hà Nội và đánh giá tư duy của Đại học Bách khoa Hà Nội năm 2023','Học phí dự kiến năm học 2023 – 2024 của Học viện Tài chính như sau:\r\n\r\n- Chương trình chuẩn: Từ 22 – 24 triệu đồng/sinh viên/năm học.\r\n\r\n- Chương trình chất lượng cao: Từ 48 – 50 triệu đồng/sinh viên/năm học.\r\n\r\n- Diện tuyển sinh theo đặt hàng: Từ 42 – 44 triệu đồng/sinh viên/năm học.\r\n\r\nTừ những năm học sau học phí có thể thay đổi, nếu tăng thì không quá 10% so với năm học trước.\r\n\r\n- Học phí đối với lưu học sinh diện tự túc kinh phí: Theo quy định của Học viện đối với sinh viên nước ngoài diện tự túc kinh phí.\r\n\r\n- Chương trình liên kết đào tạo mỗi bên cấp một bằng đại học giữa Học viện Tài chính với Trường Đại học Greenwich (Vương quốc Anh), học phí không thay đổi trong suốt 4 năm học như sau:\r\n\r\n+ Học 4 năm trong nước là: 70 triệu đồng/sinh viên/năm học (280 triệu đồng/sinh viên/khóa học)\r\n\r\n+ Học 3 năm trong nước + 1 năm tại Trường Đại học Greenwich (Vương quốc Anh) là: 70 triệu đồng/sinh viên/năm học (cho 3 năm học trong nước); 470 triệu đồng/sinh viên/năm học (cho 1 năm học tại Trường Đại học Greenwich); tổng cộng là: 680 triệu đồng/sinh viên/khóa học.\r\n\r\n- Chương trình liên kết đào tạo Đại học Toulon cấp bằng học trong 3 năm: Chuyên ngành Bảo hiểm - Ngân hàng - Tài chính là 171 triệu đồng (mức học phí bình quân: 57 triệu đồng/sinh viên/năm học); Chuyên ngành Kế toán - Kiểm soát - Kiểm toán là 180 triệu đồng (mức học phí 2 năm đầu là 57 triệu đồng/sinh viên/năm học, riêng năm cuối là 66 triệu đồng/sinh viên/ năm học).\r\n\r\nHàng năm, với mục đích khuyến khích học tập và giúp đỡ cho sinh viên gặp khó khăn Học viện có nhiều chính sách miễn giảm học phí và đa dạng các loại học bổng cho sinh viên theo học như: Học bổng khuyến khích học tập; Học bổng doanh nghiệp; ....','Hiện nay, tổ chức bộ máy của Học viện Tài chính gồm 14 khoa, 12 ban chức năng và tương đương, 02 Viện, 03 Trung tâm, 01 tạp chí.\r\n\r\nTính đến ngày 31/12/2022 Học viện Tài chính có tổng số viên chức, lao động hợp đồng của Học viện là 633 cán bộ, trong đó có 423 giảng viên; 210 cán bộ, viên chức quản lý, phục vụ và nghiên cứu viên. Trong số, 423 giảng viên có 02 Giáo sư, 48 Phó Giáo sư, 162 Tiến sĩ, 207 Thạc sĩ và 04 Nhà Giáo Nhân Dân, 11 Nhà Giáo Ưu Tú.\r\n\r\nĐể đạt được các mục tiêu đã đặt ra Học viện Tài chính đã định hướng phát triển đội ngũ giáo viên theo hướng chú trọng nâng cao năng lực và thành tích NCKH. Kết hợp hài hòa giữa nghiên cứu cơ bản, nghiên cứu ứng dụng và nghiên cứu triển khai, chủ động hội nhập quốc tế trên các mặt hoạt động của Học viện, trong đó tập trung vào hoạt động đào tạo đại học chính quy, bồi dưỡng cán bộ và nghiên cứu khoa học,\r\n\r\nKhông những thế, Học viện còn thực hiện đổi mới quản trị Đại học gắn liền với tự chủ và trách nhiệm giải trình xã hội, tạo môi trường học thuật cởi mở, sáng tạo và quốc tế, thực hiện các chính sách tăng cường thu hút được các thanh niên ưu tú và học giả xuất sắc đến tu nghiệp và nghiên cứu tại Học viện Tài chính.','Ký túc xá của Học viện Tài chính bao gồm 4 khu đảm bảo nơi ở khang trang, đầy đủ các tiện nghi sinh hoạt, đảm bảo an ninh, an toàn và vệ sinh cho gần 2000 sinh viên nội trú. Mạng wifi phủ khắp Học viện và ký túc xá sinh viên và ngày càng được cải tạo, nâng cấp, đáp ứng nhu cầu của cán bộ, giảng viên và sinh viên, hướng tới mục tiêu xây dựng Học viện theo mô hình đại học thông minh.\r\n\r\nHiện nay, Học viên Tài chính có hơn 13 Câu lạc bộ sinh viên trực thuộc quản lý của Hội Sinh viên Học viện Tài chính như: CLB Sinh viên tình nguyện vận động hiến máu nhân đạo, CLB Tình nguyện trẻ, CLB Sinh viên tình nguyện Vì trẻ thơ, CLB Guitar, CLB Nhảy hiện đại – KIF, CLB Bạn gái, CLB Kỹ năng cuộc sống, CLB Kinh tế xanh, CLB Tiếng Anh, CLB Sách và hành động, CLB Bóng chuyền, CLB Bóng rổ, CLB Tài năng trẻ và các CLB hội nhóm khác.','Thư viện Học viện Tài chính là một trong những đơn vị hình thành cùng với sự ra đời của trường Đại học Tài chính - Kế toán (năm 1963). Buổi đầu mới thành lập có 815 tên sách với 11.600 cuốn, một vài loại báo, tạp chí trong nước.\r\n\r\nNgày 22/04/2002 theo quyết định số 221/QĐ-HVTC-TCCB, Thư viện được mở rộng thành lập thành Trung tâm Thông tin và Thư viện trên cơ sở sáp nhập giữa Thư viện trường Đại học Tài chính - Kế toán, Thư viện khoa học Tài chính thuộc Bộ Tài chính và một phần của Trung tâm tin học thuộc trường Đại học Tài chính - Kế toán.\r\n\r\nNgày 01/8/2010 Thư viện lại được tách từ Trung tâm Thông tin và Thư viện thành một đơn vị độc lập để phù hợp với nhiệm vụ chuyên sâu hơn trong phục vụ thông tin tư liệu cho việc nghiên cứu, giảng dạy và học tập của Học viện.\r\n\r\nHiện nay, Học viện đã đầu tư để phát triển thư viện ngày càng hiện đại, phong phú chủng loại giáo trình, sách chuyên ngành; chuyên khảo và các lĩnh vực văn hóa, lịch sử, kỹ năng mềm... phục vụ đa dạng nhu cầu của người đọc. Giảng viên, sinh viên được chọn và mượn sách trực tuyến. Đến thư viện không chỉ để mượn và đọc sách mà còn là nơi yên tĩnh, phù hợp với việc ôn tập, học tập, trao đổi của sinh viên, học viên. Bên cạnh đó, dựa theo quy mô phòng đọc chung, phòng học nhóm và phòng đọc ngoại ngữ đều được trang bị màn hình TV 60 inch.','http://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320368/jzv3k1ayzn9dhb9iihgo.webp','http://res.cloudinary.com/dk7v6fhhu/image/upload/v1710320370/xtjquzvas1ynju3ngtga.webp','2024-03-13 08:59:28','2024-03-13 08:59:28');
