INSERT INTO `Messages` VALUES (39,28,'heloo','Chào bạn, rất vui khi gặp lại bạn. Bạn muốn tìm hiểu thêm thông tin gì về quy trình tuyển sinh hoặc các vấn đề liên quan đến việc ứng tuyển vào trường đại học?','2024-02-16 07:57:31','2024-02-16 07:57:31','Xin chào?'),(40,28,'học phí FTU là bao nhiêu ','Trong thông tin mình đã cung cấp trước đây, học phí cho chương trình đại học chính quy ngành Kinh tế và ngành Quản trị kinh doanh (Mã ngành NTH02) tại Trường đại học ngoại thương Hà Nội là 25.000.000 VNĐ mỗi năm.','2024-02-16 07:58:05','2024-02-16 07:58:05','Học phí của Đại học Ngoại Thương là bao nhiêu?'),(41,28,'FTU ở đâu ','Trường Đại học Ngoại Thương (FTU) có địa chỉ tại 91 Phố Chùa Láng, Láng Thượng, Đống Đa, Hà Nội.','2024-02-16 08:59:23','2024-02-16 08:59:23','Trường Đại học Ngoại thương ở đâu?'),(42,28,'website là gì ','Website của Trường Đại học Ngoại Thương (FTU) Hà Nội là https://www.ftu.edu.vn/.','2024-02-16 10:25:47','2024-02-16 10:25:47','Website là gì?'),(43,28,'số điện thoại thì sao ','Số điện thoại của Trường Đại học Ngoại Thương (FTU) Hà Nội là 024.3259.5158.','2024-02-16 10:29:33','2024-02-16 10:29:33','Số điện thoại là gì?'),(44,28,'bao nhiêu điểm thì học được ở đây ','Điểm chuẩn năm 2023 để có cơ hội học tại Trường Đại học Ngoại Thương là 27,8 điểm.','2024-02-16 10:30:42','2024-02-16 10:30:42','Bạn cần bao nhiêu điểm để có thể học ở đây?'),(45,28,'Ngành cntt ở FTU ','Dựa theo thông tin mà bạn cung cấp và lịch sử cuộc trò chuyện, chúng ta không thấy thông tin cụ thể về ngành công nghệ thông tin (CNTT) tại Trường Đại học Ngoại Thương (FTU) Hà Nội. Để biết được chi tiết về học phí, học bổng, cơ sở vật chất, thời gian tuyển sinh, và các thông tin liên quan khác của ngành CNTT tại FTU, bạn nên liên hệ trực tiếp với trường tại số điện thoại 024.3259.5158 hoặc truy cập trang web chính thức https://www.ftu.edu.vn/ để được cung cấp thông tin chính xác và đầy đủ nhất.','2024-02-16 15:50:56','2024-02-16 15:50:56','Ngành công nghệ thông tin tại Đại học Ngoại Thương như thế nào?'),(46,28,'bao giờ thì mới có ngành cntt ở FTU','Hiện tại không có thông tin chính thức về việc Trường Đại học Ngoại Thương (FTU) sẽ mở ngành công nghệ thông tin (CNTT). Để biết thông tin cập nhật nhất, bạn có thể theo dõi trang web chính thức của trường hoặc liên hệ trực tiếp qua số điện thoại của FTU là 024.3259.5158.','2024-02-16 16:01:49','2024-02-16 16:01:49','Khi nào FTU sẽ mở ngành công nghệ thông tin?'),(47,28,'sdt ftu còn số nào khác không ','Số điện thoại chính thức mà bạn có thể liên hệ với Trường Đại học Ngoại Thương (FTU) Hà Nội là 024.3259.5158. Đây là số đã được cung cấp trong thông tin trước đây và không có thông tin về số điện thoại khác. Nếu bạn cần thông tin thêm, hãy thử liên hệ số này hoặc truy cập website của trường.','2024-02-16 16:03:26','2024-02-16 16:03:26','Số điện thoại của Đại học FPT còn số nào khác 0?'),(48,28,'website truownfg la gi','Website của Trường Đại học Ngoại Thương (FTU) Hà Nội là https://www.ftu.edu.vn/.','2024-02-19 08:42:00','2024-02-19 08:42:00','Website Trường là gì?'),(52,28,'ngành an toàn thông tin ở FTU ','Dựa theo thông tin mà bạn cung cấp và lịch sử cuộc trò chuyện, chúng ta không thấy thông tin cụ thể về ngành an toàn thông tin tại Trường Đại học Ngoại Thương (FTU) Hà Nội. Để biết được thông tin chi tiết, bạn nên liên hệ trực tiếp với trường tại số điện thoại 024.3259.5158 hoặc truy cập trang web chính thức https://www.ftu.edu.vn/ để được cung cấp thông tin chính xác và đầy đủ nhất.','2024-02-26 14:06:56','2024-02-26 14:06:56','Ngành an toàn thông tin ở Đại học Ngoại Thương như thế nào?'),(53,28,'oke tôi sẽ liên hệ ','Rất vui khi được hỗ trợ bạn. Nếu cần thêm thông tin hoặc có bất kỳ câu hỏi nào khác về quá trình tuyển sinh hoặc chương trình đào tạo, đừng ngần ngại liên lạc với trường. Chúc bạn may mắn và thành công trong quá trình tìm hiểu và đăng ký vào FTU.','2024-02-26 14:09:59','2024-02-26 14:09:59','Bạn sẽ liên hệ như thế nào?'),(54,32,'tôi đói quá ','Rất tiếc, nhưng tôi không thể cung cấp thông tin liên quan đến việc bạn đang cảm thấy đói. Tôi có thể giúp bạn với mọi thắc mắc liên quan đến quá trình tuyển sinh và các thông tin liên quan đến việc học tại Trường đại học ngoại thương Hà Nội hoặc các vấn đề liên quan đến việc chuẩn bị và quyết định việc học đại học. Nếu bạn có thắc mắc về việc học hoặc tuyển sinh, xin vui lòng cho tôi biết để tôi có thể hỗ trợ bạn.','2024-02-29 08:44:52','2024-02-29 08:44:52','Tôi phải làm gì khi đói?'),(55,32,'trường đại học công nghệ nằm ở đâu ','Rất tiếc, nhưng thông tin bạn hỏi không liên quan đến Trường đại học Ngoại Thương Hà Nội mà tôi chuyên hỗ trợ. Tuy nhiên, nếu bạn cần tìm hiểu thông tin về Trường đại học Ngoại Thương Hà Nội, tôi có thể cung cấp thông tin chi tiết cho bạn.','2024-02-29 08:48:56','2024-02-29 08:48:56','Trường Đại học Công nghệ nằm ở địa điểm nào?'),(58,35,'hồ sơ nhập học của FTU ','Hồ sơ nhập học của Trường Đại học Ngoại thương (FTU) thông thường bao gồm các loại giấy tờ sau:\n\n1. Đơn đăng ký dự thi: Học sinh cần nộp mẫu đơn đăng ký dự thi theo quy định của trường.\n2. Bản sao giấy chứng minh nhân dân/Thẻ căn cước công dân hoặc hộ chiếu.\n3. Bản sao học bạ THPT đã công chứng.\n4. Bản sao giấy chứng nhận kết quả thi của các kỳ thi như SAT, ACT, A-Level (nếu có và phù hợp với yêu cầu của trường đối với thí sinh quốc tế hoặc các chương trình đào tạo quốc tế).\n5. Giấy khám sức khỏe.\n6. Các loại giấy tờ khác (nếu có): giấy khen, giấy chứng nhận các hoạt động ngoại khóa, giấy chứng nhận ngoại ngữ, v.v.\n\nLưu ý: Đây là các giấy tờ cơ bản thường được yêu cầu, tuy nhiên tùy theo từng năm và từng chương trình đào tạo cụ thể mà có thể có những yêu cầu khác. Do đó, bạn cần truy cập website chính thức của trường hoặc liên hệ trực tiếp qua điện thoại số 024.3259.5158 để cập nhật thông tin chính xác và đầy đủ nhất.\n\nNếu bạn là thí sinh quan tâm đến ngành Luật tại FTU, bạn cũng cần chuẩn bị hồ sơ theo hướng dẫn và tiêu chí cụ thể của ngành, đôi khi đi kèm với bài luận cá nhân hoặc phỏng vấn.\n\nDịch tiếng Việt:\n\nHồ sơ nhập học của FTU thường gồm có các giấy tờ sau:\n\n1. Đơn đăng ký dự thi: Bạn cần nộp mẫu đơn theo quy định của trường.\n2. Bản sao có công chứng CMND/CCCD hoặc hộ chiếu.\n3. Bản sao có công chứng học bạ THPT.\n4. Bản sao giấy chứng nhận kết quả thi SAT, ACT, A-Level (nếu có và theo yêu cầu của trường cho sinh viên quốc tế hoặc các chương trình quốc tế).\n5. Giấy khám sức khỏe.\n6. Các giấy tờ khác (nếu có): giấy khen, chứng nhận hoạt động ngoại khóa, chứng chỉ ngoại ngữ, v.v.\n\nĐây là thông tin sơ lược, hãy truy cập website của trường hoặc liên hệ trực tiếp để biết thông tin chính xác nhất, nhất là đối với những yêu cầu đặc biệt của từng chương trình đào tạo năm cụ thể hoặc ngành học bạn quan tâm như ngành Luật, có thể sẽ cần chuẩn bị thêm bài luận cá nhân hoặc phỏng vấn.','2024-03-14 07:31:15','2024-03-14 07:31:15','Hồ sơ nhập học của Đại học Ngoại thương bao gồm những gì?'),(59,35,'có cần phải bản sao học bạ THPT không ','Có, bạn cần chuẩn bị bản sao học bạ THPT đã được công chứng nếu bạn muốn xét tuyển vào Trường Đại học Ngoại thương (FTU). Học bạ THPT là một trong những giấy tờ quan trọng trong hồ sơ xét tuyển đại học, và việc này được nêu trong danh sách giấy tờ cần thiết mà tôi đã liệt kê trước đó.\n\nDịch tiếng Việt: \nVâng, bạn cần chuẩn bị bản sao có công chứng học bạ THPT để nộp hồ sơ xét tuyển vào Trường Đại học Ngoại thương (FTU). Học bạ THPT là một phần không thể thiếu trong hồ sơ xét tuyển của bạn.','2024-03-14 07:45:12','2024-03-14 07:45:12','Cần bản sao học bạ THPT không?'),(60,35,'Trường đại học công nghệ nằm ở đâu ','Trường Đại học Công nghệ không cung cấp thông tin cụ thể, nhưng nếu bạn đang hỏi về Trường Đại học Công nghệ thuộc Đại học Quốc gia Hà Nội, địa chỉ của trường là 144 Xuân Thủy, Cầu Giấy, Hà Nội, Việt Nam. Bạn nên kiểm tra lại hoặc cung cấp thông tin cụ thể hơn về tên trường bạn quan tâm để nhận được thông tin chính xác.\n\nDịch tiếng Việt:\nNếu bạn muốn biết thông tin về Trường Đại học Công nghệ thuộc Đại học Quốc gia Hà Nội, địa chỉ là 144 Xuân Thủy, Cầu Giấy, Hà Nội, Việt Nam. Tuy nhiên, bạn cần cung cấp thêm thông tin chi tiết hơn về tên đầy đủ của trường bạn đang tìm kiếm để có được thông tin chính xác nhất.','2024-03-14 07:45:44','2024-03-14 07:45:44','Trường đại học công nghệ nằm ở địa điểm nào?'),(61,35,'tôi đang học trường đại học công nghệ thì có học được trường đại học ngoại thương không ','Dĩ nhiên, việc học tại Trường Đại học Công nghệ không ngăn cản bạn có cơ hội được học tại Trường Đại học Ngoại Thương (FTU) nếu bạn quyết định chuyển đổi hướng nghiệp hoặc tiếp tục phát triển kỹ năng của mình. Để học được ở FTU, bạn cần phải:\n\n1. Đáp ứng các yêu cầu của phương thức tuyển sinh mà FTU áp dụng. Các phương thức tuyển sinh có thể bao gồm xét tuyển dựa trên học bạ THPT, kết quả thi học sinh giỏi, kết hợp chứng chỉ ngoại ngữ quốc tế và học bạ, điểm SAT, ACT, A-Levels hoặc kết quả thi tốt nghiệp THPT.\n\n2. Nếu bạn đã hoàn thành một phần chương trình học tại Trường Đại học Công nghệ và muốn chuyển tiếp sang FTU, bạn nên kiểm tra xem có thể chuyển giao các tín chỉ đã học được không, hoặc bạn cần phải bắt đầu lại từ đầu.\n\n3. Chuẩn bị hồ sơ xét tuyển theo yêu cầu của FTU, bao gồm nhưng không giới hạn ở đơn đăng ký, bản sao công chứng giấy tờ tùy thân, học bạ, giấy chứng nhận ngoại ngữ (nếu có), giấy khám sức khỏe, và các loại giấy tờ khác theo yêu cầu.\n\n4. Liên hệ trực tiếp với bộ phận tuyển sinh của FTU để nhận được thông tin chính xác và cập nhật.\n\nNhớ rằng việc chuyển đổi giữa các trường đại học cần cân nhắc kỹ lưỡng, vì có thể liên quan đến vấn đề về việc chuyển đổi ngành học, tín chỉ, và có thể ảnh hưởng đến tổng thời gian học. Do vậy, hãy đảm bảo rằng bạn đã hiểu rõ về các quy trình và yêu cầu cần thiết trước khi quyết định chuyển tiếp giữa các trường.','2024-03-14 07:47:03','2024-03-14 07:47:03','Tôi có thể học cùng lúc tại trường đại học công nghệ và đại học ngoại thương không?'),(62,35,'tôi vừa hỏi câu gì ','Bạn vừa hỏi về hồ sơ nhập học của Trường Đại học Ngoại thương (FTU), và tôi đã cung cấp thông tin về các giấy tờ thường được yêu cầu trong hồ sơ đăng ký dự thi hoặc xét tuyển vào trường, bao gồm cả lời khuyên về việc liên hệ trực tiếp với trường để nhận thông tin chính xác và cập nhật nhất.','2024-03-14 07:48:25','2024-03-14 07:48:25','Tôi vừa hỏi câu gì?');
